import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <AppBar position="static">
            <Toolbar>
                <Typography variant="h6" style={{ flexGrow: 1 }}>
                    My Application
                </Typography>
                <Button color="inherit" component={Link} to="/">Home</Button>
                <Button color="inherit" component={Link} to="/signup">Signup</Button>
                <Button color="inherit" component={Link} to="/edit-profile">Edit Profile</Button>
                <Button color="inherit" component={Link} to="/dashboard">Dashboard</Button>
                <Button color="inherit" component={Link} to="/inventory">Inventory</Button>
                <Button color="inherit" component={Link} to="/barcode-selector">Barcode Selector</Button>
                
                <Button color="inherit" component={Link} to="/label-printer">Label Printer</Button>
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
